import React from 'react';
import './css/navbar.module.css';

import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <h1>TENTANG INDONESIA</h1>
            <p>Pemersatu Bangsa</p>

            <section className="menu">
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>Olahraga</li>
                    <li>Kesehatan</li>
                </ul>
            </section>
        </nav>

    )
}

export default Navbar;
